local function modifyTable(tt,baseId)
	local id = baseId
    for key, value in orderedPairs (tt) do
		value.id=id
		value["properties"]= 
                    {
                        ["vnav"] = 1,
                        ["scale"] = 0,
                        ["vangle"] = 0,
                        ["angle"] = 0,
                        ["steer"] = 2,
                    }
		id = id+1
	
		local vec3 = coord.LLtoLO(value.latitude, value.longitude)
		value["x"] = vec3.x;
		value["y"] = vec3.z;
		value["latitude"] = nil;
		value["longitude"] = nil;
	end
end

